// JavaScript Document
var day;
var str = "";
var val;
var sem;
var year = '0';

$(document).ready(function(){
	$( "select" )
	.change(function () {
		
		$( "select option:selected" ).each(function() {
                        val = $(this).val();
			str = dictSearch(day,val,sem,year) ;
			});
			$( "pre#output" ).text( str );
			})
			.change();
	$(function () { 
    $("img").popover({
        //title: 'Enter Mobile Number', 
        content: "Duplicate course listings means multiple sections for queried times.",
        trigger: 'hover',
        delay: {show: 0, hide: 0}
    });  
});
});

 
	$('body').on('click', '#stubb.btn-group button', function (e) {
		
		day = $(this).val();
		str = dictSearch(day, val, sem, year);
		$("pre#output").text(str);
		
	
	
    $(this).addClass('active');
    $(this).siblings().removeClass('active');
    //do any other button related things
});

$('body').on('click', '#sem.btn-group button', function (e) {
		
		sem = $(this).val();
		str = dictSearch(day, val, sem, year);
		$("pre#output").text(str);
		
	
	
    $(this).addClass('active');
    $(this).siblings().removeClass('active');
	
    //do any other button related things
});

$('body').on('click', '#years.btn-group button', function (e) {
		
		year = $(this).val();
		str = dictSearch(day, val, sem, year);
		$("pre#output").text(str);
		
	
	
    $(this).addClass('active');
    $(this).siblings().removeClass('active');
    //do any other button related things
});


