function filtery(alst, year) {
	var len  = alst.length;
	var newlst = [];
	if (year == '0') {
		return alst;
	}
	for (var i = 0; i < len; ++i) {
		if (alst[i].charAt(4) == year) {
			newlst.push(alst[i]);
		}
	}
	return newlst;
}
function fives(lst) {
	var len = lst.length;
	var output = [];
	for (var index = 0; index < len; ++index) {
		if (index % 5 == 0 && index != 0) {
			output.push('\n' + lst[index]);
		}
		else {
			output.push(lst[index]);
		}
	}
	return output;
}
